DROP TABLE IF EXISTS `registrovehiculos`;
CREATE TABLE `registrovehiculos` (
  `id` int(10) unsigned NOT NULL auto_increment,
  `placas` varchar(45) NOT NULL default '',
  `torre` varchar(45) NOT NULL default '',
  `color` varchar(45) NOT NULL default '',
  `orden` varchar(45) NOT NULL default '',
  `folio` text,
  `asesor` varchar(200) NOT NULL default '',
  `vehiculo` varchar(100) NOT NULL default '',
  `colorVehiculo` varchar(45) NOT NULL default '',
  `fechaEntrada` date NOT NULL default '0000-00-00',
  `horaEntrada` time NOT NULL default '00:00:00',
  `fechaSalida` date NOT NULL default '0000-00-00',
  `horaSalida` time NOT NULL default '00:00:00',
  `comentarios` longtext,
  `creo` int(10) unsigned NOT NULL default '0',
  `edito` int(10) unsigned NOT NULL default '0',
  `fechaAct` datetime NOT NULL default '0000-00-00 00:00:00',
  `agencia` int(10) unsigned default NULL,
  `departamento` int(10) unsigned default NULL,
  `fin` tinyint(1) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10447 DEFAULT CHARSET=latin1;

